import styled from "styled-components";
import img from "../assets/img/logo.png";

export default function Logo(){
    return(
        <>
            <Imagem src={img}></Imagem>
            <Nome>TrackIt</Nome>
        </>
    )
}

const Nome=styled.div`
    width: 100%;
    left: 97px;
    top: 160px;
    font-family: 'Playball';
    font-style: normal;
    font-weight: 400;
    font-size: 68.982px;
    line-height: 86px;
    display:flex;
    text-align: center;
    color: #126BA5;
`
